Resolution affirming the designation by the Landmarks Preservation Commission of the Hamilton Heights/Sugar Hill Northwest Historic District generally bounded by Convent Avenue and West 151st Street and the west side of St. Nicholas Avenue, just south of West 151st Street, north to the southwest corner of St. Nicholas Avenue and West 155th Street, Manhattan, Designation List No. 336, LP-2105 (L.U. No. 233; 20035001 HKM; N 030006 HKM).
.Body

By Council Members Katz and Felder


	WHEREAS, the Landmarks Preservation Commission filed with the Council on June 28, 2002 a copy of its designation dated June 18, 2002 (the "Designation"), of the Hamilton Heights/Sugar Hill Northwest Historic District generally bounded by Convent Avenue and West 151st Street and the west side of St. Nicholas Avenue, just south of West 151st Street, north to the southwest corner of St. Nicholas Avenue and West 155th Street, Borough of Manhattan, as its landmark site pursuant to Section 3020 of the New York City Charter;

WHEREAS, the Designation is subject to review by the Council pursuant to Section 3020 of the City Charter;

WHEREAS, the City Planning Commission submitted to the Council on August 14, 2002 its report on the Designation dated August 7, 2002 (the "Report"); 

WHEREAS, upon due notice, the Council held a public hearing on the Designation on October 1, 2002;  and

WHEREAS, the Council has considered the land use implications and other policy issues relating to the Designation;

RESOLVED:

Pursuant to Section 3020 of the City Charter, and on the basis of the information and materials contained in the Designation and the Report, the Council affirms the Designation.


_________



Adopted.

Office of the City Clerk, }
The City of New York,  } ss.:

I hereby certify that the foregoing is a true copy of a Resolution passed by The Council of The City of New York on October 9, 2002, on file in this office.

